import React from "react";
import elementImage from "../imgs/5-elements.webp";

const Bazi = () => {
  return (
    <div className="bazi-container">
      <div className="bazi-left-box">
        <h1>What is Bazi?</h1>
        <h2>八字 / Ba Zi / </h2>
        <p>
          BaZi is an ancient art of destiny reading from China. Traditionally
          used to tell one’s fortune, it was also considered a concept for
          Metaphysics, Numerology and Astrology. I practice BaZi with a modern
          approach, redefining traditional fortune telling to personal guidance
          to the well-being of life. Inside each one of us lives a unique
          balance of energy, reflecting in our BaZi charts. It is based on
          complex combinations of Chinese characters and the following five
          elements: wood, fire, earth, metal and water. Furthermore, BaZi is
          also linked to Traditional Chinese Medicine and the application of
          FengShui. It is the ancient wisdom of energy and balance. BaZi tells
          us about who we are, such as information on the state of our health,
          our personality traits, conscious and subconscious thoughts, also our
          actions and interactions with the universe.
        </p>
      </div>
    </div>
  );
};

export default Bazi;
